}

function App() {
  // renderDropBoxList()

  var dbx = new Dropbox.Dropbox({ accessToken:'sl.BTM8p1hUryxLBE7t78zRbtqGQcxqXTXxED0-htBMWx8jYshBX0HCWmXPyqacpwtqwDkwHVazHw7AmMFVLxZpuXPEENcTC0Gekm7rkcaAVu7-Qij0sMqM6lpZUpp6VbQPSYdP_UDuVQEr' });
  // console.log(dbx);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
